#if _runtime(_ObjC)
import NSSlowString
#endif

private func expectEqualIterators(
  label: String,
  expected: [UInt8],
  others: [String: [UInt8]],
  _ message: @autoclosure () -> String = "",
  showFrame: Bool = true,
  stackTrace: SourceLocStack = SourceLocStack(),
  file: String = #file,
  line: UInt = #line
) {
  let expectedString = String(decoding: expected, as: UTF8.self)
  let expectedCodeUnits = expectedString._nfcCodeUnits
  for (otherLabel, other) in others {
    let otherString = String(decoding: other, as: UTF8.self)
    expectEqual(
      expectedCodeUnits,
      otherString._nfcCodeUnits,
      "\(label) vs \(otherLabel)",
      stackTrace: stackTrace.pushIf(showFrame, file: file, line: line))
  }
}

var tests = TestSuite("StringNormalization")

//==------------------------------------------------------------------------==//
// Older stdlib with ICU and supporting Unicode 11
//==------------------------------------------------------------------------==//

tests.test("StringNormalization/ConvertToNFC")
.skip(.custom({
      if #available(macOS 10.14, iOS 12, watchOS 5, tvOS 12, *) { return false }
      return true
    }, reason: "NormalizationTest.txt requires Unicode 11"))
.code {
  for test in normalizationTests {
    expectEqualIterators(
      label: "NFC",
      expected: test.NFC,
      others: [
        "source": test.source,
        "NFC": test.NFC,
        "NFD": test.NFD
      ],
      stackTrace: SourceLocStack(test.loc))
  }
}

tests.test("StringNormalization/ConvertNFK*ToNFKC")
.skip(.custom({
      if #available(macOS 10.14, iOS 12, watchOS 5, tvOS 12, *) { return false }
      return true
    }, reason: "NormalizationTest.txt requires Unicode 11"))
.code {
  for test in normalizationTests {
    expectEqualIterators(
      label: "NFKC",
      expected: test.NFKC,
      others: [
        "NFKC": test.NFKC,
        "NFKD": test.NFKD
      ],
      stackTrace: SourceLocStack(test.loc))
  }
}

//==------------------------------------------------------------------------==//
// Newer stdlib with native normalization and supporting Unicode 15
//==------------------------------------------------------------------------==//

if #available(SwiftStdlib 5.9, *) {
  tests.test("StringNormalization15/ConvertToNFC")
  .code {
    for test in normalizationTests14 {
      expectEqualIterators(
        label: "NFC",
        expected: test.NFC,
        others: [
          "source": test.source,
          "NFC": test.NFC,
          "NFD": test.NFD
        ],
        stackTrace: SourceLocStack(test.loc)
      )
    }
  }

  tests.test("StringNormalization15/ConvertNFK*ToNFKC")
  .code {
    for test in normalizationTests14 {
      expectEqualIterators(
        label: "NFKC",
        expected: test.NFKC,
        others: [
          "NFKC": test.NFKC,
          "NFKD": test.NFKD
        ],
        stackTrace: SourceLocStack(test.loc)
      )
    }
  }
}

